// load a text file for processing
val textFile = sc.textFile("file:///data/hello-world/big_data.txt")

// get the first line of the text file
textFile.first

//textFile.collect.foreach(println)
// tokenize the words in the file
val tokenizedFileData = textFile.flatMap(line=>line.split(" "))

val countPrep = tokenizedFileData.map(word=>(word, 1))
val counts = countPrep.reduceByKey((acc, nv)=>acc + nv)
val sortedCounts = counts.sortBy(kvPair=>kvPair._2, false)
